////////////////////////////////
// game screen characteristics:
var gameWidth = 700;
var gameHeight = 600;

var sideLen = 10;

var wallRows = 12*5;
var wallCols = 14*5;

////////////////////////////////
// movement and position:
var sc = 10;
var playerWidth = 2;
var playerHeight = 3;
var x0 = gameWidth/2;
var y0 = 500;
var theta = 0;
var acc = 0.1;
var dtheta = 0.1;
var alpha = 0.0025;

////////////////////////////////
// toggled values:
var left = false;
var right = false;
var forward = false;

var rotationalInertia = false;
var isPaused = false;
var mouseIsDown = false;
var initialWallVisibility = false;
var editMode = true;

////////////////////////////////
// other:
var G = 1; // gravitational constant
var collisionRadius = sc * 10;
var placementType = 0; // Walls = 0, Attractors = 1, Start Position = 2, Landing Pad = 3
var nAttractors = 0;
var globalSaveString;

var currentLevel = 0;
var levels = [];

////////////////////////////////
// game pieces 

var wallGrid = new Array(wallRows);
for(row = 0; row < wallRows; row++){
    wallGrid[row] = new Array(wallCols);
    for(col = 0; col < wallCols; col++){
        wallGrid[row][col] = new Wall(sideLen, sideLen * col, sideLen * row, "black");
    }
}

var attractorList = [];

function selectPlacementType(choice){
	// should be integer in [0, 3]

	if(choice >= 0 && choice <= 3){
		placementType = choice;
	}
}

var gameScreen = {
    canvas : document.createElement("canvas"),

    start : function(){
        this.canvas.width = gameWidth;
        this.canvas.height = gameHeight;
        this.context = this.canvas.getContext("2d");
        document.body.insertBefore(this.canvas, document.body.childNodes[0]);
        this.interval = setInterval(updateGameScreen, 20);
    },

    clear : function(){
        this.context.clearRect(0, 0, this.canvas.width, this.canvas.height);
    }
}

function Point(x, y){
    this.x = x;
    this.y = y;
}

function Segment(p1x, p1y, p2x, p2y){
    this.x1 = p1x;
    this.y1 = p1y;

    this.x2 = p2x;
    this.y2 = p2y;
}

function rotX(x, y, theta){

    let rot_x = x * Math.cos(theta) - y * Math.sin(theta);
    return rot_x;
}

function rotY(x, y, theta){

    let rot_y = x * Math.sin(theta) + y * Math.cos(theta);
    return rot_y;
}

function distanceBetweenPoints(p1x, p1y, p2x, p2y){

    return Math.sqrt((p1x - p2x) * (p1x - p2x) + (p1y - p2y) * (p1y - p2y));
}

function segmentsIntersect(a, b){
	// checks if line segment a1-a2 intersects with segment b1-b2
    if(a.x1 == a.x2){
        // special case where one segment is perfectly vertical. All xs and ys are swapped, and math is equivalent.

        var denominator = (b.x1 - b.x2) * (a.y2 - a.y1) - (a.x2 - a.x1) * (b.y1 - b.y2);

        if(denominator == 0){
            //segments are parallel
            return false;
        }

        var numerator = (b.x1 - a.x1) * (a.y2 - a.y1) - (a.x2 - a.x1) * (b.y1 - a.y1);

        var s = numerator / denominator;

        if(s < 0 || s > 1){
            return false;
        }

        var t = ( (b.y1 - a.y1) - (b.y1 - b.y2) * s ) / (a.y2 - a.y1);

        if(t < 0 || t > 1){
            return false;
        }

        //segsToDraw.push(a);

        return true;
    }
    else{
        var denominator = (b.y1 - b.y2) * (a.x2 - a.x1) - (a.y2 - a.y1) * (b.x1 - b.x2);

        if(denominator == 0){
            //segments are parallel
            return false;
        }

        var numerator = (b.y1 - a.y1) * (a.x2 - a.x1) - (a.y2 - a.y1) * (b.x1 - a.x1);

        var s = numerator / denominator;

        if(s < 0 || s > 1){
            return false;
        }

        var t = ( (b.x1 - a.x1) - (b.x1 - b.x2) * s ) / (a.x2 - a.x1);

        if(t < 0 || t > 1){
            return false;
        }

        //segsToDraw.push(a);

        return true;
    }
}

function multiSegmentIntersect(segList1, segList2){
	// same as segmentsIntersect, but taking lists of segments for each input.

    // handling this function with multiple cases because segList.length throws an error if it is not an array
    if(Array.isArray(segList1)){
        // case where both segLists have multiple values
        if(Array.isArray(segList2)){
            for(i = 0; i < segList1.length; i++){
                for(j = 0; j < segList2.length; j++){
                    if(segmentsIntersect(segList1[i], segList2[j])){
                        return true;
                    }
                }
            }
            return false;
        }

        // case whereonly segList1 has multiple values, segList2 is singular
        for(i = 0; i < segList1.length; i++){
            if(segmentsIntersect(segList1[i], segList2)){
                return true;
            }
        }
        return false;
    }

    if(Array.isArray(segList2)){
        // case where segList2 is an array, segList1 is singular
        for(i = 0; i < segList2.length; i++){
            if(segmentsIntersect(segList2[i], segList1)){
                return true;
            }
        }
        return false;
    }

    // finally, the case where both segLists are singular
    return segmentsIntersect(segList1, segList2);
}

function getMousePosition(canvas, event){
    let rect = canvas.getBoundingClientRect();
    let x = event.clientX - rect.left;
    let y = event.clientY - rect.top;
    return [x, y];
}

function toggleRotationalInertia(){
	if(!isPaused){
	    rotationalInertia = !rotationalInertia;
	    player1.omega = 0;
	}
}

function togglePause(){

	isPaused = !isPaused;
}

document.addEventListener('keydown', (event) => { // pause
    if(event.keyCode == 80){ // p
    	togglePause();
    }
})

document.addEventListener('keydown', (event) => { // do stuff

    if(event.keyCode == 32){ // spacebar
        toggleRotationalInertia();
        player1.omega = 0;
    }

    if(event.keyCode == 38){ // up arrow key
        forward = true;
    }

    if(event.keyCode == 37){ // left arrow key
        left = true;
    }

    if(event.keyCode == 39){ // right arrow key
        right = true;
    }

    selectPlacementType(event.keyCode - 48);

    if(event.keyCode == 82){ // r
    	loadSave(globalSaveString);
    }

    if(event.keyCode == 83){ // s
    	globalSaveString = saveGame();
    }

    if(event.keyCode == 69){ // e
    	changeEditMode();
    }
    
    if(event.keyCode == 81){ // q
    	changeEditMode(0);
    }

    if(event.keyCode == 87){ // w
    	changeEditMode(1);
    }

    // console.log(event.keyCode);
})

document.addEventListener('keyup', (event) => {

    if(event.keyCode == 38){
        forward = false;
    }

    if(event.keyCode == 37){
        left = false;
    }

    if(event.keyCode == 39){
        right = false;
    }
})

gameScreen.canvas.addEventListener('mousedown', (event) =>{ // placing things
	if(!editMode){
        return;
    }

    mouseIsDown = true;

	event.preventDefault();

	let row = Math.floor(event.clientY / sideLen);
    let col = Math.floor(event.clientX / sideLen);

    if(placementType == 0){ // walls
    	initialWallVisibility = wallGrid[row][col].visibility;
    	wallGrid[row][col].toggle();
    }

    else if(placementType == 1){ // attractor
    	
    	let idx = attractorExists(row,col);

    	if(idx == -1){
    		attractorList.push(new Attractor((col + 1/2) * sideLen, (row + 1/2) * sideLen, 200, 'blue'));
    	}
    	else{
    		attractorList.splice(idx, 1);
    	}
    	
    }

    else if(placementType == 2){ // player1
    	player1.x0 = event.clientX;
    	player1.y0 = event.clientY;

    	player1.vx = 0;
    	player1.vy = 0;
    }

    else if(placementType == 3){ // landing pad
    	landingPad.x = event.clientX;
    	landingPad.y = event.clientY;
    }
})

gameScreen.canvas.addEventListener('mouseup', () =>{

	mouseIsDown = false;
})

gameScreen.canvas.addEventListener('mouseleave', () =>{

	mouseIsDown = false;
})

gameScreen.canvas.addEventListener('mousemove', (event) =>{
	if(!mouseIsDown || placementType != 0){
		return;	
	}

	event.preventDefault();

	let row = Math.floor(event.clientY / sideLen);
    let col = Math.floor(event.clientX / sideLen);

	if(initialWallVisibility){
		if(row < wallRows && col < wallCols){
			wallGrid[row][col].deactivate();	
		}
	}

	else{
		if(row < wallRows && col < wallCols){
			wallGrid[row][col].activate();	
		}
	}
})

function attractorExists(row, col){
	// checks if there is currently an attractor at this position

	for(i = 0; i < attractorList.length; i++){
		if(attractorList[i].x > col * sideLen && attractorList[i].x < (col + 1) * sideLen){
			if(attractorList[i].y > row * sideLen && attractorList[i].y < (row + 1) * sideLen){
				return i;
			}
		}
	}
	return -1;
}

function LandingPad(x0, y0, r){
	this.x = x0;
	this.y = y0;
	this.r = r;

	this.vis = false;
	
	this.update = function(x, y, r, color){
		this.vis = true;
		this.x = x;
		this.y = y;
		this.r = r;

		ctx = gameScreen.context;
		ctx.strokeStyle = color;
		ctx.beginPath();
		ctx.arc(this.x, this.y, this.r, 0, 2 * Math.PI);
		ctx.stroke();
	}
}

function Wall(sideLen, x0, y0){
    this.x = x0;
    this.y = y0;
    this.side = sideLen;

    this.topSeg    = new Segment(x0, y0, x0 + sideLen, y0);
    this.bottomSeg = new Segment(x0, y0 + sideLen, x0 + sideLen, y0 + sideLen);
    this.leftSeg   = new Segment(x0, y0, x0, y0 + sideLen);
    this.rightSeg  = new Segment(x0 + sideLen, y0, x0 + sideLen, y0 + sideLen);

    this.visibility = false;

    this.update = function(color){
        if(this.visibility){
            ctx = gameScreen.context;
            ctx.fillStyle = color;
            ctx.fillRect(this.x, this.y, sideLen, sideLen);
        }
    }

    this.activate = function(){
        this.visibility = true;
    }
    this.deactivate = function(){
        this.visibility = false;
    }
    this.toggle = function(){
        this.visibility = !this.visibility;
    }
}

function Attractor(x0, y0, mass, color){
    this.x = x0;
    this.y = y0;
    this.mass = mass;

    this.update = function(){
        ctx = gameScreen.context;

        ctx.fillStyle = "blue";
        ctx.beginPath();
        ctx.arc(this.x, this.y, 1 + Math.cbrt(this.mass), 0, 2 * Math.PI);
        ctx.fill();
    }

    this.netDv = function(px, py){
        // px and py are player position (center of mass)
        var distance = Math.sqrt( (px - this.x)*(px - this.x) + (py - this.y)*(py - this.y));

        if(distance == 0){
        	death();
        	return;
        }

        dvx = (G * this.mass * (this.x - px) ) / (distance * distance * distance);
        dvy = (G * this.mass * (this.y - py) ) / (distance * distance * distance);

        return [dvx, dvy];
    }
}

function Player(sc, x0, y0, theta, acc, color){
    
    this.sc = sc;

    this.x0 = x0;
    this.y0 = y0;
    this.theta = theta;
    
    this.vx = 0;
    this.vy = 0;
    this.omega = 0;

    this.acc = acc;
    this.alpha = alpha;

    this.update = function(){
        ctx = gameScreen.context;


        this.p1x = this.x0 + rotX(0, -playerHeight * (2/3) * this.sc, this.theta);
        this.p1y = this.y0 + rotY(0, -playerHeight * (2/3) * this.sc, this.theta);

        this.p2x = this.x0 + rotX(-playerWidth * (1/2) * this.sc, (1/3) * playerHeight * this.sc, this.theta);
        this.p2y = this.y0 + rotY(-playerWidth * (1/2) * this.sc, (1/3) * playerHeight * this.sc, this.theta);

        this.p3x = this.x0 + rotX( playerWidth * (1/2) * this.sc, (1/3) * playerHeight * this.sc, this.theta);
        this.p3y = this.y0 + rotY( playerWidth * (1/2) * this.sc, (1/3) * playerHeight * this.sc, this.theta);


        ctx.fillStyle = color;
        ctx.beginPath()
        ctx.moveTo(this.p1x, this.p1y)
        ctx.lineTo(this.p2x, this.p2y)
        ctx.lineTo(this.p3x, this.p3y)
        ctx.fill()

        if(forward && !isPaused){
        	this.bfx = 2*this.x0 - this.p1x;
        	this.bfy = 2*this.y0 - this.p1y;

        	ctx.fillStyle = "red";

        	ctx.beginPath()
        	ctx.moveTo(this.p2x, this.p2y);
        	ctx.lineTo(this.p3x, this.p3y);
        	ctx.lineTo(this.bfx, this.bfy);

        	ctx.fill();
        	
        }
    }

    this.updateCollisionRadiusLimits = function(){
        this.xmin = Math.max(Math.floor((this.x0 - collisionRadius) / sideLen), 0);
        this.xmax = Math.min(Math.ceil((this.x0 + collisionRadius) / sideLen), wallCols);

        this.ymin = Math.max(Math.floor((this.y0 - collisionRadius) / sideLen), 0);
        this.ymax = Math.min(Math.ceil((this.y0 + collisionRadius) / sideLen), wallRows);                
    }
    
    this.getSegments = function(){
        this.playerSegments = [];

        this.playerSegments.push(new Segment(this.p1x,this.p1y, this.p2x, this.p2y));
        this.playerSegments.push(new Segment(this.p1x,this.p1y, this.p3x, this.p3y));
        this.playerSegments.push(new Segment(this.p2x,this.p2y, this.p3x, this.p3y));

        return this.playerSegments;
    }

    this.newPosition = function(){

    	if(isPaused){
    		return;
    	}

    	this.x0 += this.vx;
    	this.y0 += this.vy;

        let temp;

        for(i = 0; i < attractorList.length; i++){
        	temp = attractorList[i].netDv(this.x0, this.y0);
        	this.vx += temp[0];
        	this.vy += temp[1];
        }

        if(rotationalInertia){
            this.theta += this.omega;
        }

        if(forward){
            this.vx += this.acc * Math.sin(this.theta);
            this.vy += this.acc * -Math.cos(this.theta);
        }

        if(rotationalInertia){
            if(left && !right){
                this.omega += -this.alpha;
            }

            if(right && !left){
                this.omega += this.alpha;
            }
        }
        else{
            if(left && !right){
                this.theta += -dtheta;
            }

            if(right && !left){
                this.theta += dtheta;
            }
        }

        playerSegments = this.getSegments();

        this.collisionWithBorder(playerSegments);
        this.collisionWithWalls(playerSegments);
    }

    this.collisionWithBorder = function(playerSegments){

        if(multiSegmentIntersect(border.top, playerSegments)){
            if(this.vy < 0){
                this.vy = 0;
            }
        }

        if(multiSegmentIntersect(border.bottom, playerSegments)){
            if(this.vy > 0){
                this.vy = 0;
            }
        }

        if(multiSegmentIntersect(border.right, playerSegments)){
            if(this.vx > 0){
                this.vx = 0;
            }
        }

        if(multiSegmentIntersect(border.left, playerSegments)){
            if(this.vx < 0){
                this.vx = 0;
            }
        }
    }

    this.collisionWithWalls = function(playerSegments){

    	this.updateCollisionRadiusLimits();

        for(row = this.ymin; row < this.ymax; row++){
            for(col = this.xmin; col < this.xmax; col++){


                if(wallGrid[row][col].visibility){

                    if(row != 0){
                        if(!wallGrid[row - 1][col].visibility){
                            if(this.vy > 0){
                                // top
                                if(multiSegmentIntersect(wallGrid[row][col].topSeg, playerSegments)){
                                    this.vy = -0.5 * this.vy;
                                    death();
                                }
                            }
                        }
                    }

                    if(row != wallRows - 1){
                        if(!wallGrid[row + 1][col].visibility){
                            if(this.vy < 0){
                                // bottom
                                if(multiSegmentIntersect(wallGrid[row][col].bottomSeg, playerSegments)){
                                    this.vy = -0.5 * this.vy;
                                    death();
                                }
                            }
                        }
                    }

                    if(col != 0){
                        if(!wallGrid[row][col - 1].visibility){
                            if(this.vx > 0){
                                // left
                                if(multiSegmentIntersect(wallGrid[row][col].leftSeg, playerSegments)){
                                    this.vx =  -0.5 * this.vx;
                                    death();
                                }
                            }
                        }
                    }

                    if(col != wallCols - 1){
                        if(!wallGrid[row][col + 1].visibility){
                            if(this.vx < 0){
                                // right
                                if(multiSegmentIntersect(wallGrid[row][col].rightSeg, playerSegments)){
                                    this.vx = -0.5 * this.vx;
                                    death();
                                }
                            }
                        }
                    }
                } 
            }
        }
    }
}

var border = {
  top:    new Segment(0, 0, gameWidth, 0),
  bottom: new Segment(0, gameHeight, gameWidth, gameHeight),
  left:   new Segment(0, 0, 0, gameHeight),
  right:  new Segment(gameWidth, 0, gameWidth, gameHeight)
};

var landingPad = {
	x: 500,
	y: 100,
	r: 50,
	color: "green"
};

function drawLandingPad(){
	ctx = gameScreen.context;

	ctx.beginPath();
	ctx.arc(landingPad.x, landingPad.y, landingPad.r, 0, 2 * Math.PI);

	ctx.strokeStyle = landingPad.color;
	
	ctx.stroke();
}

