function startGame(){
    player1 = new Player(sc, x0, y0, theta, acc, "black");

    levels = loadPresetLevels();

    loadSave(levels[0]);

    gameScreen.start();
}

function updateGameScreen(){

	    
    gameScreen.clear();

    drawLandingPad();

    player1.newPosition();
    player1.update();

    for(i = 0; i < attractorList.length; i++){
    	attractorList[i].update();
    }

    for(row = 0; row < wallRows; row += 1){
        for(col = 0; col < wallCols; col += 1){
            wallGrid[row][col].update("black");
        }
	}

	if(isInsideLandingPad()){
		
		nextLevel();
	}
}

function saveGame(){
	let saveString = [];

	saveString += 'player1.x0=' + player1.x0.toString() + ';';
	saveString += 'player1.y0=' + player1.y0.toString() + ';';
	saveString += 'player1.theta=' + player1.theta.toString() + ';';
	saveString += 'player1.omega=0;';

	saveString += 'player1.vx=0;';
	saveString += 'player1.vy=0;';

	// need to clear attractor list first

	saveString += 'attractorList=[];';

	for(i = 0; i < attractorList.length; i++){
		saveString += 'attractorList.push(new Attractor('
		saveString += attractorList[i].x.toString() + ',';
		saveString += attractorList[i].y.toString() + ',';
		saveString += attractorList[i].mass.toString() + ", 'blue'));";
	}

	for(row = 0; row < wallRows; row++){
		for(col = 0; col < wallCols; col++){
			saveString += 'wallGrid[' + row.toString() + '][' + col.toString() + '].visibility=' + wallGrid[row][col].visibility.toString() + ';';
		}
	}

	saveString += 'landingPad.x=' + landingPad.x.toString() + ';';
	saveString += 'landingPad.y=' + landingPad.y.toString() + ';';

	console.log(saveString)
	return saveString;
}

function loadSave(saveString){

	eval(saveString);
	player1.omega = 0;
}

function nextLevel(){
	if(currentLevel >= levels.length - 1){
		return;
	}

	currentLevel++;

	loadSave(levels[currentLevel]);
}

function prevLevel(){
	if(currentLevel == 0){
		return;
	}

	currentLevel--;

	loadSave(levels[currentLevel]);
}

function resetLevel(){

	loadSave(levels[currentLevel]);
}

